import React from "react";
import Customer from "./Components/Customer";
import Users from "./Components/Users";

function App() {
    return (
        <div className="container">
            <div className="row">
                <div className="col-md-6">
                    <Customer name="Arsh" />
                </div>
                <div className="col-md-6">
                    <Users userId={1} userName={Arsh}/>
                </div>
            </div>
        </div>
    );
}

export default App
